export default function TextInput({ name }) {
  return (
    <>
      <div class="govuk-form-group">
        <h1 class="govuk-label-wrapper">
          <label class="govuk-label govuk-label--l" for="event-name">
            {name}
          </label>
        </h1>
        <input class="gov-uk-input" id="event-name" type="text" />
      </div>
    </>
  );
}
